$(document).ready(()=>{"use strict";const externalLinks=()=>{const internalHost=[location.hostname];const protocolPattern=/^https?:\/\//i;$("a").each((index,element)=>{const href=$(element).attr("href");if(protocolPattern.test(href)){const hrefHostname=$(new URL(href)).attr("hostname");if($.inArray(hrefHostname,internalHost)===-1){$(element).attr("target","_blank");$(element).attr("rel","noopener noreferer")}}})};const renderClock=element=>{const date=new Date;const hour=String(date.getUTCHours()).padStart(2,"0");const minute=String(date.getUTCMinutes()).padStart(2,"0");const second=String(date.getUTCSeconds()).padStart(2,"0");element.html(hour+":"+minute+":"+second)};$(document).ajaxSuccess(()=>{externalLinks()});const init=()=>{setInterval(()=>{renderClock($(".eve-time-wrapper .eve-time-clock"))},500);externalLinks();if(typeof hljs!=="undefined"&&typeof hljs.highlightAll==="function"){hljs.highlightAll()}};init()});